import React from 'react';
import './Footer.css';

const Footer = () => {
    return (
        <div className='footer'>
            <h1>Desarrollado Por:</h1>
            <ul>
                <li>Santiago Gesam√° Valencia</li>
                <li>Cesar Augusto Osorio</li>
                <li>Miguel Angel Rueda</li>
            </ul>
        </div>
    );
}

export default Footer;
